import React from 'react';
import { Link } from 'react-router-dom';

const Profile = () => {
    return (
        <Link to="#" className='px-3 py-3 mb-[2px] rounded-3xl duration-150 ease-linear flex items-center text-link gap-x-4 font-normal group hover:bg-linkHover'>
            <div className='group-hover:scale-[1.1] duration-150'>
                <div className='w-6 h-6 rounded-full'>
                    <img src='https://instagram.fadb3-2.fna.fbcdn.net/v/t51.2885-19/309210061_792562535329026_8220886606656014798_n.jpg?stp=dst-jpg_s150x150&_nc_ht=instagram.fadb3-2.fna.fbcdn.net&_nc_cat=106&_nc_ohc=90aCYVPr2RMAX9ymo-O&edm=ACWDqb8BAAAA&ccb=7-5&oh=00_AfB6d-SGxAh5eeBDV0LtvibjvxCDYI9GGp94rER5A7v5Ag&oe=641615C6&_nc_sid=1527a3"' className='w-6 h-6' alt='' />
                </div>
            </div>
            <span>Profil</span>
        </Link>
    );
};

export default Profile;
